import 'dart:convert';

import 'data.dart';

class GetInvestingHistoryResponse {
	String? message;
	Data? data;

	GetInvestingHistoryResponse({this.message, this.data});

	factory GetInvestingHistoryResponse.from(Map<String, dynamic> data) {
		return GetInvestingHistoryResponse(
			message: data['message'] as String?,
			data: data['data'] == null
						? null
						: Data.(data['data'] as Map<String, dynamic>),
		);
	}



	Map<String, dynamic> () {
		return {
			'message': message,
			'data': data?.(),		};
	}

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [GetInvestingHistoryResponse].
	factory GetInvestingHistoryResponse.fromJson(String data) {
		return GetInvestingHistoryResponse.from(json.decode(data) as Map<String, dynamic>);
	}
  /// `dart:convert`
  ///
  /// Converts [GetInvestingHistoryResponse] to a JSON string.
	String toJson() => json.encode(());
}
